import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  getStarted:{
    display:'flex',
    marginTop:'40px'
  },
  inputDiv:{

    '& *':{
      border:0,
      height: '60px',
      width:'300px',
      border: '1px solid #E3E7E2',
      borderRadius: '100px 0px 0px 100px',
    }
  },
  buttonDiv:{
    '& button':{
      paddingTop:'cacl(50% - 18px)',
      height: '60px',
      fontFamily: 'Roboto',
      fontSize: '18px',
      fontStyle: 'normal',
      fontWeight: '400',
      lineHeight: '24px',
      letterSpacing: '0em',
      textAlign: 'center',
      border: '1px solid #E3E7E2',
      borderRadius: '0 100px 100px 0',
      backgroundColor:"#415AFF",
      color:'white',
      textAlign:'center',
      display:"flex"
    }
  },
  text:{
    color:'grey',
    fontSize:'13px !important'
  },
  testButton:{
    fontSize:'18px !important',
    display:"block"
  }

})
